import React from 'react';
import styled from 'styled-components';
import { Title} from '../styled/theme';
const Main = styled.div`
    margin-top: 10vh;
    margin-bottom: 10vh;
    margin-left: 10vw;
    margin-right: 10vw;
`;

const RecentImgs = () => {
	return(
		<Main>
            Recent Stories
		</Main> 
	);
};

export default RecentImgs;
